css:
.tab-bar {
  display: flex !important;
  flex-wrap: wrap !important;
  overflow-y: visible;
  height: auto !important;
}
.tab-bar::after {
  display: none !important;
}
.tab-bar .tab {
  display: block !important;
  top: 0 !important;
  min-width: 12em !important;
  max-width: 20em !important;
}
